    false,nt"url": null,nt"notes": "This Marsh and Water Management Plan (MWMP)
    is intended to guide the management of Agassiz NWR wetlands into the twenty-first
    century. The foundation on which this MWMP is based is a cumulative body of knowledge
    derived from literature reviews, refuge studies, annual narrative reports, annual
    operational water plans, and the experience of staff members. The previous MWMP,
    prepared in 1965, contained many basic concepts that are  valid today. Since then,
    considerable work in the field of wetlands research has yielded new management techniques.
    These techniques, combined with changes in refuge objectives, the necessity to improve
    physical facilities, the increased complexity of water management, and the turnover
    of personnel, prompted the updating of this plan. The plan was developed to provide
    refuge personnel with a comprehensive understanding of the past, present and future
    of the water management program at Agassiz NWR.",nt"license_title": "License
